import React from "react";
import Form from './Check/ValidForm';

function FormItem(props) {

    let template = {
        title: 'Test Crud',
        fields: [
            {
                title: 'Name',
                type: 'text',
                name: 'nameitem',
                validationProps: {
                    required: 'name item does not exist'
                }
            },
            {
                title: 'Description',
                type: 'text',
                name: 'description',
                validationProps: {
                    required: 'description will not null'
                }
            },
            {
                title: 'Url image',
                type: 'url',
                name: 'urlimage'
            },
        ]
    }

    return (
        <Form
            template={template}
            validate={validate}
            onSubmit={onSubmit}
        />
    );
}


function onSubmit(values) {
    console.log(values);
}

